import './App.css';

const Book = ({ title, author, price }) => (
  <div className="book">
    <h3>{title}</h3>
    <p>Author: {author}</p>
    <p>Price: ${price}</p>
    <button>Add to Cart</button>
  </div>
);

const App = () => {
  const books = [
    { title: 'Book 1', author: 'Author 1', price: 10.99 },
    { title: 'Book 2', author: 'Author 2', price: 14.99 },
    { title: 'Book 3', author: 'Author 3', price: 19.99 },
  ];

  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to the Book Store</h1>
        <div className="book-list">
          {books.map((book, index) => (
            <Book key={index} {...book} />
          ))}
        </div>
      </header>
    </div>
  );
};

export default App;
